<p>I have a collection, the records all have a field <code>date</code> which is an <code>ISODate</code>, for example:</p>
<pre><code>{
  date: 12 January 2020,
  event: &quot;start&quot;,
},
{
  date: 23 January 2020,
  event: &quot;stop&quot;
},
{
  date: 23 January 2020,
  event: &quot;stop&quot;,
},
{
  date: 2 March 2020,
  event: &quot;pause&quot;
}
</code></pre>
<p>I want to find (for example) the distinct days in January of 2020 where an event of any kind occurred -- so, 12 and 23.</p>
<p>More generally, I want to find all the distinct days (ie integers) between two dates. I know I can do:</p>
<pre><code>db.collection('test').distinct('date', {
     date: {
       $gte: new Date(start),
       $lte: new Date(end),
     },
  });
</code></pre>
<p>But this does <strong>not</strong> give me the day, it gives me the whole date. On the other hand, it's easy to get a non-distinct list of all days between two dates using using <code>$dayOfMonth</code> with projection.</p>
<p>Please help!</p>

